export const   BEGIN= "BIGIN";
export const  HEAL= "HEAL";
export const ATTACK= "ATTACK" 

export const begin= (value:string) => ({
    type: BEGIN,
    value, 
})
export const heal = () => ({
    type: HEAL,
})
export const attack = (value:string) => ({
    type: ATTACK,
    value,
})
